import Logo from "../../images/Logo.svg";
import styled from "styled-components";
import { INDIGO_DYE } from "../../constants/colors";

const Nav = styled.nav`
  display: flex;
  flex-direction: row;
  position: fixed;
  width: 100%;
  margin: 0 4rem;
`;

const NavList = styled.ul`
  display: flex;
  flex-direction: row;
  margin: 0;
  padding: 0;
  height: 4rem;
`;

export const NavListItem = styled.li`
  display: inherit;
  align-items: center;
  height: 100%;
  list-style-type: none;
`;

export const NavListLink = styled(Link)`
