  &:hover {
    background-color: ${INDIGO_DYE};
  }
`;

const NavLogo = styled(Link)`
  display: flex;
  align-items: center;
  padding: 0 4rem;
`;

export const NavMenu = ({ children }) => {
  return (
    <Nav>
      <NavLogo to="/">
        <img src={Logo} alt="Kayti Jackson logo" />
      </NavLogo>
      <NavList>{children}</NavList>
    </Nav>
  );
};
